ati','Great precious mocassini',1,149,'Verde','Pallacanestro','Unisex','Adidas','https://beije-dev.s3.eu-south-1.amazonaws.com/shoes/upload/ioErik-1680707959467.jpg',100),(97,'2023-04-05 17:32:52','2023-04-05 18:04:52','Blazer','Scarpe comode','Comfort Shoes',1,86,'Nero','Sneakers','W','Nike','https://www.cisalfasport.it/dw/image/v2/BBVV_PRD/on/demandware.static/-/Sites-cisalfa-master/default/dwe4fc2c37/cisalfa/files/S5247536-100/image/S5247536_100.jpg?sw=960&sh=1200',86),(98,'2023-04-05 17:37:03','2023-04-05 18:04:52','STAN SMITH GS JR','Scarpe comode','Comfort Shoes',0,75.99,'Bianco','Sneakers','W','Adidas','errore nel parsing dei dati',75.99),(99,'2023-04-05 17:37:20','2023-04-05 18:04:52','CLIFTON 9 W','La pluripremiata Clifton è giunta alla sua nona versione. Più leggera e ammortizzata che mai. Eliminando peso e aggiungendo 3 mm di altezza della suola, la nuova Clifton 9 offre sensazioni rivitalizzanti alla pianta del piede con una nuova schiuma reattiva e un design della suola migliorato. Privata dei rinforzi e degli elementi termofusi, la tomaia semplificata è stata realizzata con metodi attenti all’ambiente e presenta un tallone più morbido, un pannello catarifrangente sul tallone e una linguetta snellita con pannello sul lato mediale.Te ne innamorerai perché è una scarpa da running rivoluzionaria, perfetta per gli allenamenti di tutti i giorni.','The award-winning Clifton is now in its ninth version. Lighter and more cushioned than ever before. Eliminating weight and adding 3 mm of sole height, the new Clifton 9 delivers revitalizing sensations to the sole of the foot with new responsive foam and an improved outsole design. Deprived of reinforcements and heat-molded elements, the simplified upper is made with environmentally conscious methods and features a softer heel, a reflective heel panel, and a streamlined tongue with a panel on the medial side.You\'ll fall in love with it because it\'s a revolutionary running shoe perfect for everyday workouts.',1,65,'Multicolor','Fitness','W','Hoka','https://www.cisalfasport.it/dw/image/v2/BBVV_PRD/on/demandware.static/-/Sites-cisalfa-master/default/dw6d8538e9/cisalfa/files/S5549719-ABIW/image/S5549719_ABIW.jpg?sw=960&sh=1200',150),(100,'2023-04-05 17:39:58','2023-04-05 18:04:52','COURT VISION MID LTR W','Scarpe comode','Comfort Shoes',0,85.99,'Nero','Sneakers','W','Nike','errore nel parsing dei dati',85.99),(101,'2023-04-05 17:40:14','2023-04-05 18:04:52','JAZZ O','Scarpe da corsa','Running Shoes',1,120,'Blu','Sneakers','M','Saucony','https://www.cisalfasport.it/dw/image/v2/BBVV_PRD/on/demandware.static/-/Sites-cisalfa-master/default/dw3a001eef/cisalfa/files/S5249765-316/image/S5249765_316.jpg?sw=960&sh=1200',110),(102,'2023-04-05 17:40:37','2023-04-05 18:04:52','CAVEN DIME M','Scarpe da corsa','Running Shoes',0,75,'Bianco','Sneakers','W','Puma',NULL,75),(103,'2023-04-05 17:42:44','2023-04-05 18:04:52','CAVEN DIME M','Scarpe da corsa','Running Shoes',0,75,'Bianco','Sneakers','W','Puma','https://www.cisalfasport.it/dw/image/v2/BBVV_PRD/on/demandware.static/-/Sites-cisalfa-master/default/dwa58a3b0e/cisalfa/files/S5399029-04/image/S5399029_04.jpg?sw=960&sh=1200',75),(104,'2023-04-05 17:42:54','2023-04-05 18:04:52','GRIZZLY SD M','BEAR GRIZZLY, una low-top stringata con tomaia realizzata in pelle di alta qualita e un tessuto molto resistente il comfort è assicurato da una soletta in schiuma da 5mm ricoperta da un sottile strato di vero sughero','BEAR GRIZZLY, a low-top lace-up with uppers made of high-quality leather and a very durable fabric comfort is provided by a 5mm foam insole covered with a thin layer of real cork',1,65,'Nero','Sneakers','M','Bear','https://www.cisalfasport.it/dw/image/v2/BBVV_PRD/on/demandware.static/-/Sites-cisalfa-master/default/dw97795c99/cisalfa/files/S4116039-02A/image/S4116039_02A.jpg?sw=960&sh=1200',100),(105,'2023-04-05 17:43:37','2023-04-05 18:04:52','GEL-NIMBUS 24','La scarpa GEL- NIMBUS 24 garantisce un\'eccellente protezione dagli impatti per 