5c99/cisalfa/files/S4116039-02A/image/S4116039_02A.jpg?sw=960&sh=1200',100),(199,'2023-04-05 18:23:29',NULL,'CLIFTON 9 W','La pluripremiata Clifton è giunta alla sua nona versione. Più leggera e ammortizzata che mai. Eliminando peso e aggiungendo 3 mm di altezza della suola, la nuova Clifton 9 offre sensazioni rivitalizzanti alla pianta del piede con una nuova schiuma reattiva e un design della suola migliorato. Privata dei rinforzi e degli elementi termofusi, la tomaia semplificata è stata realizzata con metodi attenti all’ambiente e presenta un tallone più morbido, un pannello catarifrangente sul tallone e una linguetta snellita con pannello sul lato mediale.Te ne innamorerai perché è una scarpa da running rivoluzionaria, perfetta per gli allenamenti di tutti i giorni.','The award-winning Clifton is now in its ninth version. Lighter and more cushioned than ever before. Eliminating weight and adding 3 mm of sole height, the new Clifton 9 delivers revitalizing sensations to the sole of the foot with new responsive foam and an improved outsole design. Deprived of reinforcements and heat-molded elements, the simplified upper is made with environmentally conscious methods and features a softer heel, a reflective heel panel, and a streamlined tongue with a panel on the medial side.You\'ll fall in love with it because it\'s a revolutionary running shoe perfect for everyday workouts.',1,65,'Multicolor','Fitness','W','Hoka','https://www.cisalfasport.it/dw/image/v2/BBVV_PRD/on/demandware.static/-/Sites-cisalfa-master/default/dw6d8538e9/cisalfa/files/S5549719-ABIW/image/S5549719_ABIW.jpg?sw=960&sh=1200',150),(200,'2023-04-05 18:23:34',NULL,'AIR MAX 270 GS JR','Scarpe comode','Comfort Shoes',1,129.99,'Nero','Sneakers','W','Nike','https://www.cisalfasport.it/dw/image/v2/BBVV_PRD/on/demandware.static/-/Sites-cisalfa-master/default/dw202418fe/cisalfa/files/S2012923-001/image/S2012923_001.jpg?sw=960&sh=1200',129.99),(201,'2023-04-05 18:23:38',NULL,'STAN SMITH GS JR','Scarpe comod